import React from "react";

function ImagePopup({ card, onClose }) {
    return (
      <div className={`popup popup-full-image ${card ? "popup_opened" : ""}`}>
      <figure class="popup__container-full-image">
        <img class="popup__pic"
          src={card ? card.link : ''}
          alt={card ? card.name : ''}/>
        <figcaption class="popup__pic-directory">{card ? card.name : ''}</figcaption>
        <button type="button" title="button" class="popup__close popup__close_photo" onClick={onClose}></button>
      </figure>
    </div>

    );
}

export default ImagePopup;
